summaryDoc.doc:
Repeatedly call `fn`, while `test` returns `true`. Calls `callback` when
stopped, or an error occurs.


### Example
```javascript

var count = 0;
async.whilst(
    function() { return count < 5; },
    function(callback) {
        count++;
        setTimeout(function() {
            callback(null, count);
        }, 1000);
    },
    function (err, n) {
        // 5 seconds have passed, n = 5
    }
);

```

